                  </label>
                  <input
                    type="date"
                    id="startDate"
                    name="startDate"
                    value={formData.startDate}
                    onChange={handleChange}
                    min={new Date().toISOString().split('T')[0]}
                    required
                    className="w-full px-4 py-2 border border-gray-300 rounded-lg focus:border-indigo-500 focus:ring-2 focus:ring-indigo-500 focus:ring-opacity-20 outline-none transition-all"
                  />
                </div>

                <div className="space-y-2">
                  <label htmlFor="endDate" className="flex items-center gap-2 text-gray-700 font-medium text-sm">
                    <Calendar className="h-4 w-4 text-purple-600" />
                    End Date *
                  </label>
                  <input
                    type="date"
                    id="endDate"
                    name="endDate"
                    value={formData.endDate}
                    onChange={handleChange}
                    min={formData.startDate || new Date().toISOString().split('T')[0]}
                    required
                    className="w-full px-4 py-2 border border-gray-300 rounded-lg focus:border-purple-500 focus:ring-2 focus:ring-purple-500 focus:ring-opacity-20 outline-none transition-all"
                  />
                </div>
              </div>

              {/* Location */}
              <div className="space-y-2">
                <label htmlFor="pickupLocation" className="flex items-center gap-2 text-gray-700 font-medium text-sm">
                  <MapPin className="h-4 w-4 text-pink-600" />
                  Pickup Location
                </label>
                <input
                  type="text"
                  id="pickupLocation"
                  name="pickupLocation"
                  value={formData.pickupLocation}
                  onChange={handleChange}
                  placeholder="Enter pickup location"
                  className="w-full px-4 py-2 border border-gray-300 rounded-lg focus:border-pink-500 focus:ring-2 focus:ring-pink-500 focus:ring-opacity-20 outline-none transition-all"
                />
              </div>

              {/* Contact Information */}
              <div className="space-y-2">
                <label htmlFor="customerName" className="flex items-center gap-2 text-gray-700 font-medium text-sm">
                  <User className="h-4 w-4 text-indigo-600" />
