                />
              </div>

              <div className="grid md:grid-cols-2 gap-4">
                <div className="space-y-2">
                  <label htmlFor="customerEmail" className="flex items-center gap-2 text-gray-700 font-medium text-sm">
                    <Mail className="h-4 w-4 text-purple-600" />
                    Email Address *
                  </label>
                  <input
                    type="email"
                    id="customerEmail"
                    name="customerEmail"
                    value={formData.customerEmail}
                    onChange={handleChange}
                    placeholder="your@email.com"
                    required
                    className="w-full px-4 py-2 border border-gray-300 rounded-lg focus:border-purple-500 focus:ring-2 focus:ring-purple-500 focus:ring-opacity-20 outline-none transition-all"
                  />
                </div>

                <div className="space-y-2">
                  <label htmlFor="contactNumber" className="flex items-center gap-2 text-gray-700 font-medium text-sm">
                    <Phone className="h-4 w-4 text-pink-600" />
